export default function MobilCard({ nama, stok, foto }) {
    return (
        <div className="mr-10 mb-20">
            <div className="w-100 h-52 rounded-lg bg-black">
                <img className="object-fill rounded-lg" src={foto} alt="" />
            </div>
            <h1 className="font-black text-2xl text-left my-32">{nama}</h1>
            <p className="font-semiold text-xl text-left">Stok: {stok}</p>
        </div>
    );
}
